import axios from 'axios';

const STUDENT_API_BASE_URL = "http://localhost:8443/students";
const AuthStr = "eyJhbGciOiJIUzUxMiJ9.eyJzdWIiOiIxOTQ2NDA4NjE2IiwiZXhwIjoxNzI1ODY3MTU3LCJpYXQiOjE3MjU4NjY1NTd9.xF3AQ0sjsD5vS8pQ2yYX1CV9XxCa-0nDkXWYZSZ5x3T-njXtui5O8stSdzw5eQ5kxOOrqBV7mt6A7lQI5R3rjg";

export const getStudents = () => {
    return axios.get(STUDENT_API_BASE_URL
        ,{ 'headers': { 'Authorization': AuthStr } }
    );
}
